class Test_prgs(unittest.TestCase):
    (volft, params, interpolation_method, return_real) = get_arg_from_pickle_file(
        path.join(ABSOLUTE_PATH_TO_RESOURCES, "projection.prgl.pkl")
    )[0]
    #volft = give_projection_prgl_data()        #todo uncommnet it and  it crash
    kb = create_kb(1)

    def test_wrong_number_params_too_few_parameters_TypeError(self):
        with self.assertRaises(TypeError) as cm_new:
            fu.prgs()
        with self.assertRaises(TypeError) as cm_old:
            oldfu.prgs()
        self.assertEqual(
            str(cm_new.exception), "prgs() missing 3 required positional arguments: 'volft', 'kb', and 'params'"
        )
        self.assertEqual(str(cm_new.exception), str(cm_old.exception))

    def test_NoneType_as_volume_returns_AttributeError_NoneType_obj_hasnot_attribute_extract_plane(
        self
    ):
        with self.assertRaises(AttributeError) as cm_new:
            fu.prgs(
                volft=None,
                kb=KB_IMAGE3D_SIZE_CUBIC,
                params=self.params,
                kbx=None,
                kby=None,
            )
        with self.assertRaises(AttributeError) as cm_old:
            oldfu.prgs(
                volft=None,
                kb=KB_IMAGE3D_SIZE_CUBIC,
                params=self.params,
                kbx=None,
                kby=None,
            )
        self.assertEqual(
            str(cm_new.exception), "'NoneType' object has no attribute 'extract_plane'"
        )
        self.assertEqual(str(cm_new.exception), str(cm_old.exception))

    def test_params_is_emptyList_IndexError_list_index_out_of_range(self):
        with self.assertRaises(IndexError) as cm_new:
            fu.prgs(
                volft=IMAGE_3D, kb=KB_IMAGE3D_SIZE_CUBIC, params=[], kbx=None, kby=None
            )
        with self.assertRaises(IndexError) as cm_old:
            oldfu.prgs(
                volft=IMAGE_3D, kb=KB_IMAGE3D_SIZE_CUBIC, params=[], kbx=None, kby=None
            )
        self.assertEqual(str(cm_new.exception), "list index out of range")
        self.assertEqual(str(cm_new.exception), str(cm_old.exception))

    def test_with_realimg_returns_RuntimeError_ImageFormatException_image_not_same_size(
        self
    ):
        with self.assertRaises(RuntimeError) as cm_new:
            fu.prgs(
                volft=IMAGE_2D,
                kb=KB_IMAGE3D_SIZE_CUBIC,
                params=self.params,
                kbx=None,
                kby=None,
            )
        with self.assertRaises(RuntimeError) as cm_old:
            oldfu.prgs(
                volft=IMAGE_2D,
                kb=KB_IMAGE3D_SIZE_CUBIC,
                params=self.params,
                kbx=None,
                kby=None,
            )
        msg = str(cm_new.exception).split("'")
        msg_old = str(cm_old.exception).split("'")
        self.assertEqual(msg[0].split(" ")[0], "ImageFormatException")
        self.assertEqual(msg[1], "extractplane requires a complex image")
        self.assertEqual(msg[0].split(" ")[0], msg_old[0].split(" ")[0])
        self.assertEqual(msg[1], msg_old[1])
        self.assertEqual(str(cm_new.exception), str(cm_old.exception))

    def test_kb_is_None_ArgumentError_in_EMData_extract_planec_function(self):
        with self.assertRaises(TypeError) as cm_new:
            fu.prgs(volft=IMAGE_3D, kb=None, params=self.params, kbx=None, kby=None)
        with self.assertRaises(TypeError) as cm_old:
            oldfu.prgs(volft=IMAGE_3D, kb=None, params=self.params, kbx=None, kby=None)
        output_msg = "Python argument types in\n    None.extract_plane(EMData, Transform, NoneType)\ndid not match C++ signature:\n    extract_plane(EMAN::EMData {lvalue}, EMAN::Transform tf, EMAN::Util::KaiserBessel {lvalue} kb)"
        self.assertEqual(str(cm_new.exception), output_msg)
